import { NavLink } from "react-router-dom";

export default function Layout(props) {
  const { currentUser, handleLogout } = props;
  return (
    <div>
      <header>Planterest</header>
      <nav>
        <NavLink to="/boards">
          <p>Boards</p>
        </NavLink>
      </nav>
      {props.children}
    </div>
  );
}
